import { Link } from 'react-router-dom';
import './styles.css';

export const Sushi = () => {
    return(
        <div>
            <h1>Sushi</h1>
            <form action="http://127.0.0.1:5000/api/addSushi" method="POST">      
          <input name="id" type="text" className="feedback-input" placeholder="Processed ID"  />   
          <input name="latitude" type="text" className="feedback-input" placeholder="Latitiude"  />
          <input name="longitude" type="text" className="feedback-input" placeholder="Longitude"  />
          <input name="type" type="text" className="feedback-input" placeholder="Type"  />
          <input name="tunaId" type="text" className="feedback-input" placeholder="TunaID" />
          <input type="submit" value="ADD"/>
        </form>    
        <Link to='/'>Home</Link>
        </div>
    )
}
